// src/pages/AdminPage.js
import React from "react";
import RoomForm from "../components/RoomForm";
import AdminDashboard from "../components/AdminDashboard";

function AdminPage() {
  return (
    <div>
      <h1>Admin Dashboard</h1>
      <RoomForm />
      <AdminDashboard />
    </div>
  );
}

export default AdminPage;
